interface IStack<T> {
  push: (item: T) => void;
  pop: () => void;
  peak: () => T | null;
  getSize: () => number;
  printStack: () => T[];
  clear: () => void;
  isFull: () => boolean;
}

class Stack<T> implements IStack<T> {
  private stack: T[] = [];
  private maxSize = 7;

  push = (item: T): void => {
    if (this.getSize() < this.maxSize) {
      this.stack.push(item);
    }
  };

  pop = (): void => {
    if (this.getSize()) {
      this.stack.pop();
    }
  };

  peak = (): T | null => {
    if (this.getSize()) {
      return this.stack[this.getSize() - 1];
    }
    return null;
  };

  clear = (): void => {
    this.container = [];
  };

  getSize = () => this.container.length;

  printStack = () => this.container;

  isFull = () => {
    if (this.getSize() < this.maxSize) {
      return false;
    }
    return true;
  };
}

export const stack = new Stack<string>();
